struct test1 {
	int w, r, c, *out;
} test1_data[] = {
	{8, 3, 15, test1_out1},
	{16, 27, 12, test1_out2},
	{32, 23, 6, test1_out3},
{0}};

int test1()
{
	struct test1 *tp;
	int *matrix;
	int i, n;
	int errors = 0;
	for (tp = test1_data; tp->w; ++tp) {
		matrix = talloc(int, tp->r * tp->c);
		n = 1;
		for (i = 0; i < tp->r * tp->c; ++i) {
			matrix[i] = n;
			n = galois_single_multiply(n, 2, tp->w);
		}
		if (memcmp(matrix, tp->out, sizeof *matrix * (tp->r*tp->c))) {
			++errors;
			printf ("test1 case %d EXPECTED\n", 1+tp-test1_data);
			jerasure_print_matrix(tp->out, tp->r, tp->c, tp->w);
			printf ("test1 case %d GOT\n", 1+tp-test1_data);
			jerasure_print_matrix(matrix, tp->r, tp->c, tp->w);
		}
		free(matrix);
	}
	if (errors) {
		fprintf(stderr, "*** test1 %d errors\n", errors);
	}
	return errors;
}

