struct test2 {
	int w, r, c, *out;
} test2_data[] = {
	{8, 3, 15, test2_out1},
	{16, 27, 12, test2_out2},
	{32, 23, 6, test2_out3},
{0}};

int test2()
{
	struct test2 *tp;
	int *matrix, *bitmatrix;
	int i, n;
	int errors = 0;
	for (tp = test2_data; tp->w; ++tp) {
		matrix = talloc(int, tp->r * tp->c);
		n = 1;
		for (i = 0; i < tp->r * tp->c; ++i) {
			matrix[i] = n;
			n = galois_single_multiply(n, 2, tp->w);
		}
		bitmatrix = jerasure_matrix_to_bitmatrix(tp->c, tp->r, tp->w, matrix);
		if (memcmp(bitmatrix, tp->out, sizeof *bitmatrix * (tp->r*tp->c*tp->w*tp->w))) {
			++errors;
			printf ("test2 case %d EXPECTED\n", 1+tp-test2_data);
			jerasure_print_bitmatrix(tp->out, tp->r*tp->w, tp->c*tp->w, tp->w);
			printf ("test2 case %d GOT\n", 1+tp-test2_data);
			jerasure_print_bitmatrix(bitmatrix, tp->r*tp->w, tp->c*tp->w, tp->w);
		}
		free(bitmatrix);
		free(matrix);
	}
	if (errors) {
		fprintf(stderr, "*** test2 %d errors\n", errors);
	}
	return errors;
}

