struct test4 {
	int w, k, *out;
} test4_data[] = {
	{4,3,test4_out1},
	{8,5,test4_out2},
	{3,5,0},
{0}};

int test4()
{
	struct test4 *tp;
	int *matrix, *bitmatrix;
	int *bitmatrix_copy;
	int *inverse;
	int *identity;
	int i, j, n;
	int errors = 0;
	for (tp = test4_data; tp->w; ++tp) {
		matrix = talloc(int, tp->k*tp->k);
		bitmatrix_copy = talloc(int, tp->k*tp->w*tp->k*tp->w);
		inverse = talloc(int, tp->k*tp->w*tp->k*tp->w);

		for (i = 0; i < tp->k; ++i) {
			for (j = 0; j < tp->k; ++j) {
				n = i ^ ((1 << tp->w)-1-j);
				matrix[i*tp->k+j] = (n == 0) ? 0 : galois_single_divide(1, n, tp->w);
			}
		}
		bitmatrix = jerasure_matrix_to_bitmatrix(tp->k, tp->k, tp->w, matrix);

//		printf("The Cauchy Bit-Matrix:\n");
//		jerasure_print_bitmatrix(bitmatrix, tp->k*tp->w, tp->k*tp->w, tp->w);
		memcpy(bitmatrix_copy, bitmatrix, sizeof(int)*tp->k*tp->w*tp->k*tp->w);
		i = jerasure_invertible_bitmatrix(bitmatrix_copy, tp->k*tp->w);
//		printf("\nInvertible: %s\n", (i == 1) ? "Yes" : "No");
		if (i != (tp->out != 0)) {
			++errors;
			printf ("test3 case %d: jerasure_04 %d %d\n", 1+tp-test4_data,
				tp->k, tp->w);
			printf ("test3 case %d: seems to be %sinvertible but expected %sinvertible\n",
				1+tp-test4_data,
				i ? "" : "not ",
				tp->out ? "not " : "");
		} else if (tp->out) {
			memcpy(bitmatrix_copy, bitmatrix, sizeof(int)*tp->k*tp->w*tp->k*tp->w);
			i = jerasure_invert_bitmatrix(bitmatrix_copy, inverse, tp->k*tp->w);
			if (memcmp(inverse, tp->out, sizeof *bitmatrix * (tp->k*tp->k*tp->w*tp->w))) {
				++errors;
			printf ("test3 case %d: jerasure_04 %d %d\n",
				1+tp-test4_data,
				tp->k, tp->w);
				printf ("test3 case %d EXPECTED\n", 1+tp-test4_data);
					
				jerasure_print_bitmatrix(tp->out, tp->k*tp->w, tp->k*tp->w, tp->w);
				printf ("test3 case %d GOT\n", 1+tp-test4_data);
				jerasure_print_bitmatrix(inverse, tp->k*tp->w, tp->k*tp->w, tp->w);
				identity = jerasure_matrix_multiply(inverse, bitmatrix, tp->k*tp->w, tp->k*tp->w, tp->k*tp->w, tp->k*tp->w, 2);
				printf("\ntest3 case %d Inverse times matrix (should be identity):\n", 1+tp-test4_data);
				jerasure_print_bitmatrix(identity, tp->k*tp->w, tp->k*tp->w, tp->w);
				free(identity);
			}
		}
		/* free data to avoid false positives for leak testing */
		free(bitmatrix);
		free(inverse);
		free(bitmatrix_copy);
		free(matrix);
	}
	return errors;
}

